import {Row,Col,Card,CardBody,CardImg} from 'reactstrap';
import "bootstrap/dist/css/bootstrap.min.css";

function Adidas_shoe_component() {
  return (
    <div>
         <Row>
            <Col>
            <Card  >
                <CardImg variant="top" src={Sports} />
                <CardBody>
                <a>Shoe</a>  
                </CardBody>
                </Card>
            </Col>
         </Row>

    </div>
  )
}

export default Adidas_shoe_component
